import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';
import React, { Component } from 'react'
export default class person extends Component {
constructor(props) {
    super(props);
    this.state = {
      person:{
        name:"walid",
        country:"Tunisia",
        profession : "Sales And IT Business Manager",
        biographie : " More than 20 years expeience in Travel distribution systems"
      },
      show:false
    };
}
render() {
    return (
      <>
      <Card style={{ width: '18rem' }}>
      <Card.Img variant="top" src="holder.js/100px180" />
    <Card.Body>
        <Card.Title>Personal Biography</Card.Title>
        <Card.Text>{this.state.person.name}</Card.Text>
        <Card.Text>{this.state.person.profession}</Card.Text>
        <Card.Text>{this.state.person.biographie}</Card.Text>
    </Card.Body>
    </Card>
      
      </>
    )    
}
}
